<script setup>
import {onMounted, ref} from 'vue'
import {useRoute} from 'vue-router'
import {useApi} from '@directus/extensions-sdk'
import {format} from 'date-fns'
import html2canvas from 'html2canvas'
import jsPDF from 'jspdf'

const route = useRoute()
const orderId = route.query.id
const api = useApi()
const id = 'print-form'
const innerWidth = window.innerWidth
const orderBgPng = 'data:image/png;base64,'
const printerData = ref({})

onMounted(async () => {
  const res = await api.get(`/items/order/${orderId}?fields=*.*,order_sku_detail.*.*`)
  const orderInfo = res.data.data
  let advancePrice = 0

  orderInfo.order_payment.forEach((payment) => {
    advancePrice += payment.price
  })

  orderInfo.advancePrice = advancePrice
  printerData.value = orderInfo
})

function savePDF() {
  html2canvas(document.getElementById(id)).then(canvas => {
    const a4Width = 595.28
    const a4Height = 841.89

    const options = {
      scale: 1
    }

    const canvasWidth = canvas.width / options.scale
    const canvasHeight = canvas.height / options.scale

    // 
    const pageWidth = a4Width
    const pageHeight = (a4Width / canvasWidth) * canvasHeight

    const doc = new jsPDF('p', 'pt', 'a4')
    doc.addImage(canvas.toDataURL('image/jpeg', 1), 'JPEG', 0, 0, pageWidth, pageHeight)

    doc.save(`-${printerData.value.id}.pdf`)
    // document.querySelector("#test").appendChild(canvas)
  })
}

function printNow() {
  const iframe = document.createElement('iframe')
  iframe.setAttribute('id', 'print-iframe')
  document.body.appendChild(iframe)
  const doc = iframe.contentWindow.document
  const resetCss = document.createElement('style')
  iframe.contentDocument.head.appendChild(resetCss)

  doc.write(`<body>
<style>*{margin: 0;padding:0} body{transform:scale(0.8);transform-origin: 0 0;}</style>
${document.getElementById(id).innerHTML}
</body>`)

  doc.close()
  iframe.contentWindow.focus()
  iframe.style.visibility = 'hidden'

  setTimeout(() => {
    iframe.contentWindow.print()
  }, 1000)

  setTimeout(() => {
    document.body.removeChild(iframe)
  }, 3000)
}
</script>

<template>
  <private-view title="">
    <div>
				<v-button @click="route.back()"></v-button>
      <v-button @click="savePDF">PDF</v-button>
      <v-button @click="printNow"></v-button>
      <div
:style="{
      overflow: 'visible',
      background: '#fff',
    color: '#000',
    height: `${1685 * Math.min(innerWidth/1191, 0.8)}px`,
    }">
        <div
:id="id"
             class="order-font-family"
             :style="{
        position:'relative',
    width: '1190px',
    height: '1684px',
    transform: `scale(${Math.min(innerWidth/1191, 0.8)})`,
    transformOrigin: '0 0',
    background: '#fff'
    }">
          <img :src="orderBgPng" alt="" :style='{ position: "absolute", top: "48px", width: "1190px", }'/>

          <div :style='{position: "absolute", top: "340px", left: "150px"}'>{{ printerData.id }}</div>
          <div :style='{position: "absolute", top: "411px", left: "175px"}'>{{ printerData.customer?.name }}</div>
          <div :style='{position: "absolute", top: "411px", left: "537px"}'>{{ printerData.customer?.phone }}</div>
          <div :style='{position: "absolute", top: "411px", left: "920px", whiteSpace: "nowrap"}'>{{
              format(new Date(
                  printerData.date_created), 'yyyy-MM-dd HH:mm')
            }}
          </div>
          <div :style='{position: "absolute", top: "462px", left: "175px"}'>{{ printerData?.customer?.address }}</div>
          <div :style='{position: "absolute", top: "462px", left: "888px", whiteSpace: "nowrap"}'>{{
              format(new Date(
                  printerData?.customer?.weddingDate), 'yyyy-MM-dd')
            }}
          </div>

          <div :style='{position: "absolute", top: "1010px", left: "950px"}'>
            {{ printerData.real_price }}(<s>{{ printerData.total_price }}</s>)
          </div>
          <div :style='{position: "absolute", top: "1059px", left: "950px"}'>{{ printerData.advancePrice }}</div>
          <div :style='{position: "absolute", top: "1108px", left: "950px"}'>{{
              +printerData.real_price -
              printerData.advancePrice
            }}
          </div>
          <div :style='{position: "absolute", top: "1155px", left: "215px"}'>{{ printerData.remark }}</div>

          <div :style='{position: "absolute", top: "1323px", left: "269px"}'>{{ printerData.user?.first_name }}</div>

          <div :style='{position: "absolute", top: "602px", left: "58px"}'>
            <div v-for="item in printerData.order_sku_detail" :key="item.id" style="display:flex">
              <div :style='{width: "357px"}'>{{ item?.sku?.name }}{{ item?.classify?.name }}</div>
              <div :style='{width: "463px"}'>{{ item?.sku?.code }}</div>
              <div :style='{width: "131px"}'>{{ 1 }}</div>
              <div :style='{width: "122px",textAlign:"right"}'>{{ item?.price }} <span :style='{width: "20px"}'></span>RMB
              </div>
            </div>
          </div>

        </div>
      </div>
    </div>
  </private-view>
</template>
